STRAIN_DATA = [('bray staion', {'entities': [(0, 4, 'STATION')]}),
               ('Show me bray', {'entities': [(8, 12, 'STATION')]}),
               ('Train from bray', {'entities': [(11, 15, 'STATION')]}),
               ('Next train bray', {'entities': [(11, 15, 'STATION')]}),
               ('Where is bray?', {'entities': [(9, 13, 'STATION')]})]


@plac.annotations(
    model=("Model name. Defaults to blank 'en' model.", "option", "m", str),
    new_model_name=("New model name for model meta.", "option", "nm", str),
    output_dir=("Optional output directory", "option", "o", Path),
    n_iter=("Number of training iterations", "option", "n", int))
def main(model=None, new_model_name='animal', output_dir=None, n_iter=20):
    """Set up the pipeline and entity recognizer, and train the new entity."""
    if model is not None:
        nlp = spacy.load(model)  # load existing spaCy model
        print("Loaded model '%s'" % model)
    else:
        nlp = spacy.blank('en')  # create blank Language class
        print("Created blank 'en' model")

    # Add entity recognizer to model if it's not in the pipeline
    # nlp.create_pipe works for built-ins that are registered with spaCy
    if 'ner' not in nlp.pipe_names:
        ner = nlp.create_pipe('ner')
        nlp.add_pipe(ner)
    # otherwise, get it, so we can add labels to it
    else:
        ner = nlp.get_pipe('ner')

    ner.add_label(LABEL)  # add new entity label to entity recognizer
    ner.add_label(NEWLABEL)  # add new entity label to entity recognizer

    # get names of other pipes to disable them during training
    other_pipes = [pipe for pipe in nlp.pipe_names if pipe != 'ner']
    with nlp.disable_pipes(*other_pipes):  # only train NER
        optimizer = nlp.begin_training()
        for itn in range(n_iter):
            random.shuffle(TRAIN_DATA)
            losses = {}
            for text, annotations in TRAIN_DATA:
                nlp.update([text], [annotations], sgd= nlp.begin_training(), drop=0.35,
                           losses=losses)
            print(losses)

    # test the trained model
    test_text = 'Bike Guild Street'
    doc = nlp(test_text)

    print("Entities in '%s'" % test_text)
    for ent in doc.ents:
        print(ent.label_, ent.text)

    output_dir = os.getcwd()
    nlp.to_disk(output_dir)

if __name__ == '__main__':
    plac.call(main)
